import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { FaPhone, FaInfoCircle, FaRegThumbsUp, FaArrowLeft, FaArrowRight } from 'react-icons/fa';
import vendors from '../data/vendors'; // Import vendors data from the vendors.js file
import './VendorDetails.css';

const VendorDetails = () => {
  const { id } = useParams(); // Get vendor ID from URL
  const navigate = useNavigate(); // For navigation to next/previous vendors
  const [vendor, setVendor] = useState(null); // State to hold vendor data
  const [cityVendors, setCityVendors] = useState([]); // Vendors filtered by city

  useEffect(() => {
    // Find vendor details by ID from vendors.js
    const selectedVendor = vendors.find((vendor) => vendor.id === parseInt(id, 10));
    if (selectedVendor) {
      setVendor(selectedVendor);
      // Filter vendors by the same city
      const filteredVendors = vendors.filter(v => v.city === selectedVendor.city);
      setCityVendors(filteredVendors);
    }
  }, [id]);

  // Handle previous vendor navigation
  const handlePrevVendor = () => {
    const currentIndex = cityVendors.findIndex((v) => v.id === vendor.id);
    const prevIndex = (currentIndex - 1 + cityVendors.length) % cityVendors.length; // Ensure cyclic navigation
    navigate(`/vendor/${cityVendors[prevIndex].id}`);
  };

  // Handle next vendor navigation
  const handleNextVendor = () => {
    const currentIndex = cityVendors.findIndex((v) => v.id === vendor.id);
    const nextIndex = (currentIndex + 1) % cityVendors.length; // Ensure cyclic navigation
    navigate(`/vendor/${cityVendors[nextIndex].id}`);
  };

  if (!vendor) {
    return <div>Loading...</div>; // Loading state if vendor data is not available yet
  }

  // Function to get the status circle color
  const getStatusCircleColor = (status) => {
    return status === 'Open' ? 'green' : 'red';
  };

  return (
    <div className="d-flex justify-content-center align-items-center m-4">
      {/* Previous Vendor Button */}
      <button className="btn btn-white btn-sm ms-1 me-5 py-4" onClick={handlePrevVendor}>
        <FaArrowLeft />
      </button>

      <div className="d-flex align-items-center">
        {/* Vendor Logo (Circle) */}
        <img
          src={vendor.logo}
          alt={`${vendor.name} logo`}
          style={{
            width: '80px',
            height: '80px',
            borderRadius: '50%',
            objectFit: 'cover',
            marginRight: '15px',
          }}
        />

        {/* Vendor Details Column */}
        <div className="d-flex flex-column">
          {/* Row 1: Vendor Type Badge */}
          <span
            className={`badge bg-light text-dark d-inline ${vendor.vendorType === 'Rec' ? 'bg-success' : vendor.vendorType === 'Med' ? 'bg-primary' : 'bg-warning'} mb-2`}
            style={{ fontSize: '0.75rem', padding: '0.2rem 0.4rem' }}
          >
            {vendor.vendorType}
          </span>

          {/* Row 2: Vendor Name and Rating */}
          <h4 className="mb-1 d-flex align-items-center">
            {vendor.name}
            <span className="ms-3 text-muted d-flex align-items-center" style={{ fontSize: '0.9rem' }}>
              <FaRegThumbsUp className="me-1" /> ({vendor.rating}%)
            </span>
          </h4>

          {/* Row 3: City, Delivery Time, and Minimum Order */}
          <div className="text-muted mb-2" style={{ fontSize: '0.85rem' }}>
            {vendor.city}, {vendor.state} | {vendor.deliveryTime} | ${vendor.minOrder} Min.
          </div>

          {/* Row 4: Status and Buttons */}
          <div className="d-flex align-items-center">
            {/* Status Circle */}
            <div
              style={{
                width: '10px',
                height: '10px',
                borderRadius: '50%',
                backgroundColor: getStatusCircleColor(vendor.status),
                marginRight: '5px',
              }}
            ></div>
            <small className="text-muted me-4">
              {vendor.status === 'Open' ? 'Available' : 'Closed'}
            </small>

            {/* Call Button (Light and Wide) */}
            <button className="btn btn-light btn-sm me-4" style={{ width: '120px' }}>
              <FaPhone />
            </button>

            {/* Info Button (Transparent with no text) */}
            <button className="btn btn-white btn-sm,">
              <FaInfoCircle />
            </button>
          </div>
        </div>
      </div>

      {/* Next Vendor Button */}
      <button className="btn btn-white btn-sm ms-5 py-4" onClick={handleNextVendor}>
        <FaArrowRight />
      </button>
    </div>
  );
};

export default VendorDetails;
